console.log(window)

let scrollpos = window.scrollY;

const headerer = document.querySelector(".site_header")
const scrollChanger = 180;

const add_class_on_scroll = () => headerer.classList.add("fixed_top");
const remove_class_on_scroll = () => headerer.classList.remove("fixed_top");

window.addEventListener('scroll', function() { 
  scrollpos = window.scrollY;
  console.log('test scroll')

  if (scrollpos >= scrollChanger) { add_class_on_scroll() }
  else { remove_class_on_scroll() }
  
});
